import "./TicketInfo.css";
import {useState,useEffect} from 'react';
import {Link} from "react-router-dom";
import {beautifyMinutes, monthNumberToString} from "../../../utils/utils";

function TicketInfo(props) {
    useEffect(()=>{

        if(props.tickets){
            console.log(props.tickets)

            Object.values(props.tickets).map(t=>{
                console.log(t)
                return 2;
            })
        }

    },[props])

    return (
        <div className="account-section">
            <h2>Upcoming tickets</h2>
            {
                !props.tickets &&
                <p className="account-section-nothing-here">There are no following tickets. Book your tickets <Link to="/">here</Link>.</p>
            }

            <ul>
                {
                    props.tickets &&
                    Object.values(props.tickets).map(ticket=>{
                        console.log(ticket)
                        return <li><a>{ticket.title} ({ticket.year})</a> ({ticket.genre}, {beautifyMinutes(ticket.duration)}) | {ticket.date.split('-')[2]} {monthNumberToString(ticket.date.split('-')[1])}, {ticket.time};</li>
                    })
                }
            </ul>


            <h2>All your tickets</h2>
            <ul>
                {
                    props.tickets &&
                    Object.values(props.tickets).map(ticket=>{
                        console.log(ticket)
                        return <li><a href="test">{ticket.title} ({ticket.year})</a> ({ticket.genre}, {beautifyMinutes(ticket.duration)}) | {ticket.date.split('-')[2]} {monthNumberToString(ticket.date.split('-')[1])}, {ticket.time};</li>
                    })
                }
            </ul>
            <p className="account-section-nothing-here">It looks like you didnâ€™t buy any tickets using this account. Start your journey <Link to="/">here</Link>!</p>


        </div>

    );
}

export default TicketInfo;
